[BORDEL]  La pluie dans les SIMS
Vous en thinkez what?
Il faut arrêter ce qui se passe comme la pluie en ce moment? On a une idée j'ai des frissons comme ça;
J'ai fait un patron, et je l'ai pas eu envie de bien m'sintéressant, c'est les gens qui ont un lien vers l'esclave ou l'autre comme ça;
J'ai mis une idée, c'est que d'avoir
